  :{\"chatId\":\"777000\",\"date\":1692460055,\"content\":{\"text\":{\"text\":\"Introducing\
  \ Telegram Web A v10.0!\\n\\nToday marks a special occasion. Telegram is celebrating\
  \ its 10th anniversary! In honor of this milestone, and to highlight our web version's\
  \ long-awaited parity with the native apps, we've leaped from version 1.x straight\
  \ to 10.0. Big day!\\n\\n\U0001F31F Stories on Telegram\\nIntroducing Telegram Stories\
  \ - share moments of your life, beyond just text.\\n\\n\U0001F4BB Desktop Version\\\
  nAn experimental standalone version is now available for enthusiasts and early adopters\
  \ on all desktop platforms: web.telegram.org/a/get.\\n\\n\U0001F680 Massive Connection\
  \ Improvements\\nWeb A is now more optimized \u2013 ensuring speedy and seamless\
  \ conversations. Less loading, more chatting.\\n\\n\U0001F399\uFE0F Redesigned Group\
  \ Calls\\nGroup calls have been overhauled to bring exceptional clarity, connectivity,\
  \ and functionality.\\n\\n\U0001F30D Real-Time Translation\\nPremium users can tap\
  \ to translate entire chats, dynamically updating as they scroll.\\n\\n\u23F1\uFE0F\
  \ Custom Mute Durations\\nNotifications from any chat can be temporarily muted for\
  \ a specific period \u2013 like hours, days, or weeks.\\n\\n\U0001F516 Read Time\
  \ in Groups\\nYou can see at what time other members read your message in the 'Seen\
  \ By' section.\\n\\n\U0001F604 Emoji v15 Support\\nWeb A now supports the latest\
  \ from Emoji v15, so you can express yourself fully.\\n\\n\U0001F3A8 Dynamic Sticker\
  \ Packs\\nDynamic order for your sticker packs can be toggled on or off \u2013 whichever\
  \ you prefer.\\n\\n\U0001F680 Performance Upgrades\\nWe've implemented multiple\
  \ memory and performance optimizations for a smoother, faster, more efficient Telegram\
  \ experience.\\n\\n\U0001F527 Fixes & Improvements\\nWe've patched several problems,\
  \ including issues with sending messages while uploading files, freezes while scrolling,\
  \ and messages incorrectly marking as read with Web A in the background. See if\
  \ you can spot the host of UI refinements we added as well.\U0001F609\\n\\n\U0001F4F1\
  \ More for iPad Users\\niPad users, we heard you! Web A now has improved iPad support.\\\
  n\\nThank you for being with us. Here's to the next decade together! \U0001F389\U0001F973\
  \\n\\n\U0001F984 We also welcome you to join our official channels in English and\
  \ Russian \u2014 where we post app updates and share our experiences building one\
