  :\"777000\",\"date\":1685718849,\"content\":{\"text\":{\"text\":\"Telegram Web A\
  \ was updated to version 1.61\\n\\n\U0001F929 What\u2019s New\\n\\n\u2022 Shareable\
  \ Chat Folders \u2013 Your chat folders can now be shared with friends or colleagues\
  \ \u2013 adding the folder and joining all its chats in one tap.\\n\\n\u2022 Power\
  \ Saving Mode \u2013 You can extend battery life and improve performance by turning\
  \ on Power Saving Mode or individually disabling autoplay, animations and effects\
  \ in Settings > Animations and Performance.\\n\\n\u2022 Better Bots \u2013 Telegram\
  \ bots can completely replace any website. These bots can now be launched in any\
  \ chat \u2013 try typing @DurgerKingBot (followed by a space) in any chat, or posting\
  \ this link.\\n\\n\u2022 Enhanced Design \u2013 Enjoy transparent layers with beautiful\
  \ blur effects when selecting emoji, stickers, reactions and statuses. Sending messages\
  \ also has a satisfying new animation.\\n\\n\u2022 Infinite Reactions \u2013 Telegram\
  \ Premium users can pick reactions from an infinite selection of custom emoji. They\
  \ can also use up to 3 reactions on any message to combine multiple emotions. \U0001F44D\
  \U0001F525\u2764\uFE0F\\n\\n\u2022 Preview in Media Viewer \u2013 Scrubbing through\
  \ videos now shows a thumbnail preview to easily find specific scenes.\\n\\n\u2022\
  \ Group Chat Improvements \u2013 Create groups with only yourself or restrict anyone\
  \ from adding you directly to groups (via Settings > Privacy and Security > Group\
  \ and Channels > Nobody).\\n\\n\u2022 Send When Online \u2013 By right-clicking\
  \ the Send button, you can schedule a message to be sent when the recipient comes\
  \ online.\\n\\n\U0001F60D What\u2019s Better\\n\\n\u2022 As usual, we've added a\
  \ pack of optimizations and performance improvements. If you ever run into an issue\
  \ with the app, be sure to report it on the Bugs and Suggestions Platform.\\n\\\
  n\U0001F984 We also welcome you to join our official channels in English and Russian\
  \ \u2014 where we post app updates and share our experiences building one of the\
  \ world\u2019s most feature-rich web applications.\",\"entities\":[{\"type\":\"\
